import React from "react";
import { Segment, Header, TextArea, Form, Divider, Rating } from "semantic-ui-react";

const OrderReceived = () => (
  <Segment style={{ marginTop: 20 }}>
    <Header>Review McDonalds</Header>
    <Form>
      <TextArea placeholder="Positive/negative comments about the food..." />
    </Form>
    <br />
    <Rating maxRating={5} defaultRating={5} icon="star" size="huge" />
    <br />
    <Divider />
    <Header>Review Mr. Izzudin</Header>
  </Segment>
);

export default OrderReceived;
